cafTree::cafTree(TTree *tree) : fChain(0) 
{
// if parameter tree is not specified (or zero), connect the file
// used to generate this class and read the Tree.
   if (tree == 0) {
      TFile *f = (TFile*)gROOT->GetListOfFiles()->FindObject("outputCAF_notruth_27024796_1.flat.root");
      if (!f || !f->IsOpen()) {
         f = new TFile("outputCAF_notruth_27024796_1.flat.root");
      }
      f->GetObject("cafTree",tree);

   }
   Init(tree);
}

cafTree::cafTree(TString namefile) : fChain(0) 
{

   TTree * tree;
   TFile * f = new TFile(namefile);
      
   f->GetObject("cafTree",tree);
   Init(tree);

}


cafTree::~cafTree()
{
   if (!fChain) return;
   delete fChain->GetCurrentFile();
}

Int_t cafTree::GetEntry(Long64_t entry)
{
// Read contents of entry.
   if (!fChain) return 0;
   return fChain->GetEntry(entry);
}
Long64_t cafTree::LoadTree(Long64_t entry)
{
// Set the environment to read one entry
   if (!fChain) return -5;
   Long64_t centry = fChain->LoadTree(entry);
   if (centry < 0) return centry;
   if (fChain->GetTreeNumber() != fCurrent) {
      fCurrent = fChain->GetTreeNumber();
      Notify();
   }
   return centry;
}

